import axios from 'axios';
import React from 'react'
import {useEffect , useState} from 'react'
import { GetItem } from '../actions/user';
import { config } from '../api/config';
import { connect } from "react-redux";
const ViewList = ({GetItem}) => {
  const [data , setData] = useState([]);

  useEffect(()=>{
      axios.get(config.GET_ITEM)

  .then(res=>{

      console.log("result=======>" ,res);
      setData(res.data)
  })
  .catch(err=>{
 console.log(err);
  })
  } ,[])

  GetItem(data)
return (
  <div>
    <ul>
      {
            data.map((data) =>
            <>
            <li key ={data.name} >Name : {data.name}</li>
            <li key ={data.googleReviews} >Google Review : {data.googleReviews}</li>
            <li key ={data.googleRating} >Google Rating : {data.googleRating}</li>
            <li key ={data.itemNumber} >Item Number : {data.itemNumber}</li>
            <li key ={data.description} >Description : {data.description}</li>
            <li key ={data.address} >Address : {data.address}</li>
            <li key ={data.city} >City : {data.city}</li>
            <li key ={data.state} >State : {data.state}</li>
            <li key ={data.zipCode} >Zip Code : {data.zipCode}</li>
            <li key ={data.userId} >User Id : {data.userId}</li>
            <li key ={data.itineraryId} >Itinerary Id : {data.itineraryId}</li>
            <li key ={data.itineraryDayId} >Itinerary Day Id : {data.itineraryDayId}</li>
            <li key ={data.location} >Location : {data.location}</li>

            </>



            )
      }

    </ul>
  </div>
)
}


const mapDispatchToProps =(dispatch)=>{
  return{
      GetItem: (addItemData) =>dispatch(GetItem(addItemData)),
  }   
}
const itemStore = connect(null , mapDispatchToProps)(ViewList)
export default itemStore
